export const CourseContent = {
  rows: [
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">1 УРОК.</span> Вводный урок
        </p>
      ),
      content:
        'Жизненный цикл проекта. Что такое ноды? Какие бывают награды? Почему стоит ставить ноды?',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">2 УРОК.</span> Какие нужны сервисы для
          нод
        </p>
      ),
      content: 'Взаимодействие с Discord, Medium, Twitter, YouTube, Telegram.',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">3 УРОК.</span> Что нужно чтоб ставить
          ноды?
        </p>
      ),
      content:
        'Как арендовать сервер? Как зайти на сервер? Как пользоваться терминалом? Где брать гайды?',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">4 УРОК.</span> Практика
        </p>
      ),
      content:
        'Арендуем сервер, заходим на сервер через терминал, учимся пользоваться гайдами, пошагово ставим ноду.',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">5 УРОК.</span> Как искать и отбирать
          проекты
        </p>
      ),
      content:
        'Whitepaper. Токеномика. Дорожная карта. Инвестора. Что это такое и как с этим работать.',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">6 УРОК.</span> Мультиаккаунтинг
        </p>
      ),
      content:
        'Сопоставимость нод. Как ставить несколько под на 1 сервер. KYC. Мониторинг ног. Пошаговая установка двух нод на сервер.',
    },
    {
      title: (
        <p>
          <span className="roboto fw-500 text-fill-indigo">7 УРОК.</span> GitHub
        </p>
      ),
      content: 'Что такое GitHub? Зачем он нужен в нодах? Как комитить на GitHub?',
    },
  ],
};
